function imgLike(n){if(!isAuthenticated){alert("You must login to like or comment.");return}var t=findAncestor(n,"grid-element"),i={ContentId:t.id};console.log("Liking");$.ajax({type:"POST",url:"/PhotoWall/LikeImg",dataType:"json",contentType:"application/json",data:JSON.stringify(i),success:function(n){n.success?t.querySelector(".likes-count").innerHTML=n.currentLikes:alert("Could not like...")},error:function(){}})}function findAncestor(n,t){while((n=n.parentElement)&&!n.classList.contains(t));return n}